import React, { Component } from 'react';
import { Grid, Cell, Title, Body1 } from 'react-mdc-web/lib';


export default class About extends Component {
  render() {
    return (
      <Grid>
        <Cell col={12}>
          <Title>About</Title>
        </Cell>
        <Cell col={12}>
          <Body1>[Reasons I made this ish]</Body1>
        </Cell>
      </Grid>
    );
  }
}
